const MyBoxes = ({ currentUser }) => {
    return currentUser.userBoxes.map((item, index) => {
        return (
            <li key={item.x}>
                <div>Box {index + 1}</div>
                <div>x: {item.x.toFixed(2)}</div>
                <div>y: {item.y.toFixed(2)}</div>
                <div>
                    <button type="button" className="btn btn-danger btn-sm">
                        delete
                    </button>
                </div>
            </li>
        );
    });
};

export default MyBoxes;
